  render() {

    return (

    <div className="App" style={{paddingTop: "136px", width:500, paddingLeft:600 }}>
     <Paper >
    <Table style={{paddingTop: "136px", width:500, paddingLeft:600 }}>
      <TableRow>
        <th>Choose A Number Of People</th>
        <th>Current</th>
        <th>Room + Clicked</th>
      </TableRow>
      <tr>
        <td><i className="material-icons">room</i>Room</td>
        <td><Button variant="fab" color="primary" aria-label="Remove" onClick={this.subtractRoom}><RemoveIcon /></Button></td>
        <td>{this.state.updateRoom}<Button variant="fab" color="secondary" aria-label="Add" onClick={this.addRoom}><AddIcon /></Button></td>
      </tr>
      <tr>
        <td><i className="material-icons">account_circle</i>Adults</td>
        <td><Button variant="fab" color="primary" aria-label="Remove" onClick={this.subtractAdults}><RemoveIcon /></Button></td>
        <td><Button variant="fab" color="secondary" aria-label="Add" onClick={this.addAdults}><AddIcon /></Button></td>
      </tr>
      <tr>
        <td><i className="material-icons">accessibility_new</i>Children</td>
        <td><Button variant="fab" color="primary" aria-label="Remove" onClick={this.subtractChildrens}><RemoveIcon /></Button></td>
        <td><Button variant="fab" color="secondary" aria-label="Add" onClick={this.addChildrens}><AddIcon /></Button></td>
      </tr>

</Table>
 </Paper>
    </div>
    );
  }
}

